import React, { Component } from "react";
import "./style.css";

class Index extends Component {
  state = {
    links: [
      {
        link: "Home"
      }
    ]
  };

  render() {
    return (
      <div id="header1">
        <nav>
          <ul>
            <li>
              <a href="#" className="brand1">
                <font size="6">Ride My Way</font>
              </a>
            </li>
            <li>
              <a href="#" className="link1" id="d1" onclick="active1()">
                Home
              </a>
            </li>
            <li>
              <a href="#about" className="link1" id="d2" onclick="active2()">
                About us
              </a>
            </li>
            <li>
              <a href="#login" className="link1" id="d3" onclick="active3()">
                Log in
              </a>
            </li>
            <li>
              <a href="#signup" className="link1" id="d4" onclick="active4()">
                Sign up
              </a>
            </li>
          </ul>
        </nav>
        <div class="header1">
          <br />
          <p id="offer" />
        </div>
      </div>
    );
  }
}

export default Index;
